void RegalMakeCurrent( RegalSystemContext ctx )
{
  RegalPrivateMakeCurrent( ctx );
}

void RegalContextInfo::Init( RegalContext * rCtx )
{
  rCtx->dsp.driverTbl.glGetIntegerv( GL_MAX_VERTEX_ATTRIBS, (GLint *)&maxVertexAttribs );
  std::string vendor = (const char *)rCtx->dsp.driverTbl.glGetString( GL_VENDOR );
  if( vendor == "Qualcomm" ) {
      // Qualcomm fails with float4 attribs with 256 byte stride, so artificially limit to 8 attribs
      maxVertexAttribs = 8;
  }
}
